import classes from "./NoQuoteFound.module.css";

const NoQuoteFound = () => {
    return (
        <div className={classes.noquotes}>
            <p>No Quotes Found</p>
            <a className="btn">
                Add A Quote
            </a>
        </div>
    )
};

export default NoQuoteFound;
